import { useQuery } from "@tanstack/react-query";
import { Button } from "antd";
import React from "react";
import { FieldValues, SubmitHandler, useForm } from "react-hook-form";
import { useNavigate } from "react-router-dom";
import { signUp } from "../../api/auth";
import { supabase } from "../../supabase";

const onFinish = (values: any) => {
  console.log("Success:", values);
};

const onFinishFailed = (errorInfo: any) => {
  console.log("Failed:", errorInfo);
};

type FieldType = {
  email?: string;
  password?: string;
  remember?: string;
  address?: string;
};

interface SignFormProps {
  mode: string;
  setMode: React.Dispatch<React.SetStateAction<string>>;
}

type Inputs = {
  email: string;
  password: string;
  address?: string;
};

const LoginForm: React.FC<SignFormProps> = ({ mode, setMode }) => {
  const navigate = useNavigate();
  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm<Inputs>({ mode: "onChange" });

  const onSubmit: SubmitHandler<FieldValues> = ({ email, password }) => {
    if (mode === "로그인") {
      signInHandler({ email, password });
    } else {
      signUpHandler({ email, password });
    }

    reset();
  };

  const userEmail = {
    required: "필수 입력란입니다.",
    minLength: {
      value: 4,
      message: "최소 4자를 입력해주세요.",
    },
    maxLength: {
      value: 20,
      message: "최대 20자까지 입력하실 수 있습니다..",
    },
  };

  const userPassword = {
    required: "필수 입력란입니다.",
    minLength: {
      value: 4,
      message: "최소 4자를 입력해주세요.",
    },
    maxLength: {
      value: 15,
      message: "최대 15자까지 입력하실 수 있습니다.",
    },
  };

  const confirmPassword = {
    required: "필수 입력란입니다.",
    minLength: {
      value: 4,
      message: "최소 4자를 입력해주세요.",
    },
    maxLength: {
      value: 15,
      message: "최대 15자까지 입력하실 수 있습니다.",
    },
  };

  const nickname = {
    required: "필수 입력란입니다.",
    minLength: {
      value: 1,
      message: "최소 1자를 입력해주세요.",
    },
    maxLength: {
      value: 10,
      message: "최대 10자까지 입력하실 수 있습니다.",
    },
  };

  const userAddress = {
    required: "필수 입력란입니다.",
    minLength: {
      value: 1,
      message: "최소 1자를 입력해주세요.",
    },
    maxLength: {
      value: 10,
      message: "최대 10자까지 입력하실 수 있습니다.",
    },
  };

  const signInHandler = async ({ email, password }: Inputs) => {
    try {
      const { data, error } = await supabase.auth.signUp({
        email,
        password,
      });

      console.log(email, password);

      if (error) {
        alert("아이디 또는 비밀번호를 확인해주세요");
      } else {
        alert("성공적으로 로그인 되었습니다!");
        navigate("/");
      }

      console.log(data);
    } catch (error) {
      console.log(error);
    }
  };

  const signUpHandler = async ({ email, password }: Inputs) => {
    const { data } = useQuery({
      queryKey: ["login"],
      queryFn: () => signUp(email, password),
    });

    console.log("쿼리", data);

    try {
      const { data, error } = await supabase.auth.signUp({
        email,
        password,
        // options: {
        //   emailRedirectTo: "https//example.com/welcome",
        // },
      });

      console.log(email, password);

      console.log(data);
      if (error) {
        console.log(error);
        alert("아이디와 비밀번호를 확인해주세여");
      } else {
        alert("회원가입 되었습니다. 로그인 페이지로 이동합니다.");
        setMode("로그인");
      }
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div>
      <h2>{mode === "로그인" ? "로그인" : "회원가입"}</h2>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div>
          <input type="email" {...register("email", userEmail)} />
          {errors?.email && ( // 에러 메시지
            <div>{errors?.email?.message as string}</div>
          )}
        </div>

        <div>
          <input
            type="password"
            placeholder="비밀번호"
            {...register("password", userPassword)}
          />
          {errors?.password && ( // 에러 메시지
            <div>{errors?.password?.message as string}</div>
          )}
        </div>
        {mode === "회원가입" && (
          <div>
            <input
              type="address"
              placeholder="주소"
              {...register("address", userAddress)}
            />
            {errors?.address && ( // 에러 메시지
              <div>{errors?.address?.message as string}</div>
            )}
          </div>
        )}

        {mode === "로그인" ? (
          <>
            <Button
              type="primary"
              htmlType="submit"
              onClick={handleSubmit(signInHandler)}
            >
              로그인하기
            </Button>
            <button onClick={() => setMode("회원가입")}>
              아직 계정이 없으신가요? 회원가입
            </button>
          </>
        ) : (
          <>
            <Button
              type="primary"
              htmlType="submit"
              onClick={handleSubmit(signUpHandler)}
            >
              회원가입하기
            </Button>
            <button onClick={() => setMode("로그인")}>
              이미 계정이 있으신가요? 로그인
            </button>
          </>
        )}
      </form>
    </div>
  );
};

export default LoginForm;
